import React, { useEffect, useState } from "react";
import { useSelector, useDispatch } from 'react-redux';
import { increment, decrement } from '../actions/allActions';


function Home() {
  const counter = useSelector(state => state.counter);
  const isLogged = useSelector(state => state.isLogged);
  const dispatch = useDispatch();
  const [searchResults, setSearchResults] = useState([]);


  useEffect(()=> {

    async function getData() {
      let data = await fetch('/api/flowers');
      data = await data.json();

      setSearchResults(data);
    }

    getData();
  }, [])

  return (
    <div className="home container">
      <h1>
        Startsidan!
      </h1>

      <div className="row">
        {searchResults.map(flower => 
          <div className="col s6 m6 l4">
            <div className="card">
              <div className="card-image">
                <img src={flower.url} alt="blomma"/>
                <a className="btn-floating halfway-fab waves-effect waves-light red"><i className="material-icons">add</i></a>
              </div>
              <div className="card-content">
                <span className="card-title">{flower.title}</span>
                <span className="price">{flower.price} kr</span>
              </div>
            </div>
          </div>
        )}

      </div>

      <h1>{counter}</h1>
      <button onClick={() => dispatch(increment(5))}>+</button>
      <button onClick={() => dispatch(decrement())}>-</button>
      <h3>{isLogged? 'hello':'bye'}</h3>
    </div>
  )
}

export default Home;
